script: |
  super -f text -I q186.spq | sort > q186.out

inputs:
  - name: q186.spq
    data: |
      SELECT DISTINCT + + 4 + + - col2 + ( - col0 ) / + col0 * + - col0 * + col0 FROM tab2 (FORMAT parquet) WHERE - + col2 BETWEEN NULL AND + - 44 * + + col2;
  - name: tab2

outputs:
  - name: q186.out
    data: |
